func (o *FieldseekerTreatment) Preload(name string, retrieved any) error {
	if o == nil {
		return nil
	}

	switch name {
	case "Organization":
		rel, ok := retrieved.(*Organization)
		if !ok {
			return fmt.Errorf("fieldseekerTreatment cannot load %T as %q", retrieved, name)
		}

		o.R.Organization = rel

		if rel != nil {
			rel.R.Treatments = FieldseekerTreatmentSlice{o}
		}
		return nil
	default:
		return fmt.Errorf("fieldseekerTreatment has no relationship %q", name)
	}
}

